description:
Heath Ledger ar den hoppfulla poeten Dan som hals over huvud foralskar 
sig i konstnaren Candy. Dan ar heroinmissbrukare, men Candy ar fascinerad 
och dras till honom. Tillsammans beger de sig ut pa ostadig mark, 
sammanbundna av deras vansinniga karlek och glupska sexuella aptit. 
Med hjalp av universitetsprofessorn Casper, som kan skaffa dem pengar 
och fa gratis droger, inleder de bada bohemerna en farlig flirt med doden. 
Medv: Abbie Cornish, Heath Ledger och Geoffrey Rush m.fl.
